//     func TestSomethingThatUsesNodesGetter(t *testing.T) {
//
//         // make and configure a mocked NodesGetter
//         mockedNodesGetter := &NodesGetterMock{
//             NodesFunc: func(namespace string) v1a.NodeInterface {
// 	               panic("mock out the Nodes method")
//             },
//         }
//
//         // use mockedNodesGetter in code that requires NodesGetter
//         // and then make assertions.
//
//     }
type NodesGetterMock struct {
	// NodesFunc mocks the Nodes method.
	NodesFunc func(namespace string) v1a.NodeInterface

	// calls tracks calls to the methods.
	calls struct {
		// Nodes holds details about calls to the Nodes method.
		Nodes []struct {
			// Namespace is the namespace argument value.
			Namespace string
		}
	}
}

// Nodes calls NodesFunc.
func (mock *NodesGetterMock) Nodes(namespace string) v1a.NodeInterface {
	if mock.NodesFunc == nil {
		panic("NodesGetterMock.NodesFunc: method is nil but NodesGetter.Nodes was just called")
	}
	callInfo := struct {
		Namespace string
	}{
		Namespace: namespace,
	}
	lockNodesGetterMockNodes.Lock()
	mock.calls.Nodes = append(mock.calls.Nodes, callInfo)
	lockNodesGetterMockNodes.Unlock()
	return mock.NodesFunc(namespace)
}

// NodesCalls gets all the calls that were made to Nodes.
// Check the length with:
//     len(mockedNodesGetter.NodesCalls())
func (mock *NodesGetterMock) NodesCalls() []struct {
	Namespace string
} {
	var calls []struct {
		Namespace string
	}
	lockNodesGetterMockNodes.RLock()
	calls = mock.calls.Nodes
	lockNodesGetterMockNodes.RUnlock()
	return calls
}
